import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
const Fetch = require('node-fetch');

const useStyles = makeStyles({
    root: {
        minWidth: 275,
    },
    bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
});

export default function OutlinedCard() {
    const classes = useStyles();


    return ( <
        div id = "id" > < /div >

    );
}


let url = "https://jsonplaceholder.typicode.com/posts";
let settings = { method: "Get" };
let data = Fetch(url, settings)
    .then(res => res.json())
    .then((json) => {


        return json;
    })

.catch(error => { console.log("server is down") });
let display_id = "";
let display_title = "";
let display_body = "";

const response = () => {

    data.then((a) => {
        data = a;
        var line1 = line1();
        document.getElementById("id").innerHTML = line1;
        for (var i in data) {
            console.log(i);
            console.log("------");
            console.log(data[i].id);

            display_id += data[i].id;
            console.log("------");
            console.log(data[i].title);

            display_title += data[i].title;
            console.log("------");

            console.log(data[i].body);

            display_body += data[i].body;

            display += "</h3>";
            console.log("_______________________");

        }

        document.getElementById("id").innerHTML = display;

        return data;
    });

}

function lines() {
    return ( < Card variant = 'outlined' > < CardContent > < Typography color = 'textSecondary'
        gutterBottom >
        <
        /Typography> <
        Typography variant = "h5"
        component = "h2" >
        <
        div id = "display_id" > < /div>< /
        Typography > <
        Typography color = "textSecondary" >
        <
        div id = "display_title" > < /div> < /
        Typography > <
        Typography variant = "body2"
        component = "p" >
        well meaning and kindly. <
        br / > { '"a benevolent smile"' } <
        /Typography> < /
        CardContent > <
        CardActions >
        <
        Button size = "small" > Learn More < /Button> < /
        CardActions > <
        /Card>
    );
}

console.log(response());
